import React from "react"
import {
  NavLink,  
 } 
 from "react-router-dom";

function Home () {
    return (
      <div>
        <h2>HELLO</h2>
        <p>We are building Mentee Network</p>

        <p>Stay tuned...</p>
        <li><NavLink to="/members">Find mentors</NavLink></li>
        <li><NavLink to="/">Perform tasks</NavLink></li>
        <li><NavLink to="/members">Be discovered</NavLink></li>
        <li><NavLink to="/profile">Forge your CV</NavLink></li>
      </div>

    )
  }


export default Home
